import React, { Component } from "react";
import { Link } from "react-router-dom";
import logo from "../../img/logo.png";
import "./style.css";

class Footer extends Component {
  // JSX stuff
  render() {
    return (
      <section id="footer">
        <footer className="page-footer font-small blue pt-4">
          <div className="container">
            <div className="row">
              <div className="col-md-6 col-sm-12 ">
                <section className="fale-conosco text-center">
                  <h1>Fale conosco</h1>
                  <hr class="teal accent-3 mb-4 mt-0 d-inline-block mx-auto divisor" />
                  <ul className="list-unstyled">
                    <li>
                      <i class="fas fa-envelope mr-2" />{" "}
                      primecodes.org@gmail.com
                    </li>
                    <li>
                      <i className="fas fa-phone mr-2" /> +55 061 99116-9967
                    </li>
                    <li>
                      <i className="fas fa-phone mr-2" /> +55 000 99999-9999
                    </li>
                  </ul>
                </section>
              </div>

              <div className="col-md-6 col-sm-12 ">
                <h1>Tchau</h1>
              </div>
            </div>
          </div>

          {/* Copyright */}
          <div class="footer-copyright text-center py-3">
            Â© 2018 Copyright:
            <a href="https://mdbootstrap.com/education/bootstrap/">
              {" "}
              MDBootstrap.com
            </a>
          </div>
          {/* Copyright */}
        </footer>
      </section>
    );
  }
}

export default Footer;
